import React, {useEffect, useMemo, useState} from 'react';
import {
    Button,
    Card,
    CardContent,
    OutlinedInput,
    Icon,
    TextField,
    Typography,
    CardActions,
    Divider,
    Select,
    InputLabel,
    FormControl,
    MenuItem,
    LinearProgress
} from '@material-ui/core';
import {makeStyles, useTheme} from '@material-ui/styles';
import {FuseAnimate, FuseAnimateGroup} from '@fuse';
import {useDispatch, useSelector} from 'react-redux';
import withReducer from 'app/store/withReducer';
import clsx from 'clsx';
import _ from '@lodash';
import {Link} from 'react-router-dom';
import * as Actions from '../store/actions';
import reducer from '../store/reducers';



const useStyles = makeStyles(theme => ({
    header    : {
        background: 'linear-gradient(to right, ' + theme.palette.primary.dark + ' 0%, ' + theme.palette.primary.main + ' 100%)',
        color     : theme.palette.getContrastText(theme.palette.primary.main)
    },
    headerIcon: {
        position     : 'absolute',
        top          : -64,
        left         : 0,
        opacity      : .04,
        fontSize     : 512,
        width        : 512,
        height       : 512,
        pointerEvents: 'none'
    }
}));

function Courses(props)
{
    const dispatch = useDispatch();
    const courses = useSelector(({academyApp}) => academyApp.courses.data);
    const classes = useStyles(props);
    const theme = useTheme();
    const [coursesData, setCoursesData] = useState(null);

    useEffect(() => {
        dispatch(Actions.getCourses());
    }, [dispatch]);

    useEffect(() => {
        function getCourses()
        {
            return courses;
        }

        if (courses)
        {
            setCoursesData(getCourses());
        }
    }, [courses]);


    return (
        <div className="flex flex-col flex-1 w-full">


            <div
                className={clsx(classes.header, "relative overflow-hidden flex flex-col flex-shrink-0 items-center justify-center text-center p-16 sm:p-24 h-200 sm:h-288")}>

                <FuseAnimate animation="transition.slideUpIn" duration={400} delay={100}>
                    <Typography color="inherit" className="text-24 sm:text-40 font-light">
                        WELCOME TO ACADEMY
                    </Typography>
                </FuseAnimate>

                <FuseAnimate duration={400} delay={600}>
                    <Typography variant="subtitle1" color="inherit" className="mt-8 sm:mt-16 mx-auto max-w-512">
                            <span className="opacity-75">
                                All Courses this sem. 
                            </span>
                    </Typography>
                </FuseAnimate>

                <Icon className={classes.headerIcon}>school</Icon>
            </div>

            <div className="flex flex-col flex-1 max-w-2xl w-full mx-auto px-8 sm:px-16 py-24">

                {useMemo(() => (
                    coursesData && (
                        (coursesData.length > 0) ? (
                                <FuseAnimateGroup
                                    enter={{
                                        animation: "transition.slideUpBigIn"
                                    }}
                                    className="flex flex-wrap py-24"
                                >
                                    {coursesData.map((course) => {
                                        return (
                                            <div className="w-full pb-24 sm:w-1/2 lg:w-1/3 sm:p-16" key={course.id}>
                                                <Card 
                                                elevation={1} className="flex flex-col h-256">
                                                    <div
                                                        className="flex flex-shrink-0 items-center justify-between px-24 h-64"
                                                        style={{
                                                            // background: primary,
                                                            // color     : theme.palette.getContrastText(category.color)
                                                        }}
                                                    >
                                                        <div className="flex items-center justify-center opacity-75">
                                                            <Icon className="text-20 mr-8" color="inherit">access_time</Icon>
                                                            <div className="text-16 whitespace-no-wrap">10 min</div>
                                                        </div>
                                                    </div>
                                                    <CardContent className="flex flex-col flex-auto items-center justify-center">
                                                        <Typography className="text-center text-16 font-400">{course.course__name}</Typography>
                                                        <Typography className="text-center text-13 font-600 mt-4" color="textSecondary">{course.updated}</Typography>
                                                    </CardContent>
                                                    {/* <Divider/> */}
                                                     <CardActions className="justify-center">
                                                         <Button
                                                            //  to={`/apps/academy/courses/${course.id}/${course.slug}`}
                                                            to = {`/academy/course/${course.course__id}/${course.course__name}`}
                                                            component={Link}
                                                            className="justify-start px-32"
                                                            color="secondary"
                                                        >
                                                           Enter 
                                                        </Button>
                                                    </CardActions> 

                                                </Card>
                                            </div>
                                        )
                                    })}
                                </FuseAnimateGroup>
                            ) :
                            (
                                <div className="flex flex-1 items-center justify-center">
                                    <Typography color="textSecondary" className="text-24 my-24">
                                        No courses found!
                                    </Typography>
                                </div>
                            )
                    )), [ coursesData, theme.palette])}
            </div>
        </div>
    );
}

export default withReducer('academyApp', reducer)(Courses);
